function qtyChange(qty: number) {
    let qtyChange;
    if (qty === 0) {
        return qtyChange = '';
    } else {
        qtyChange = Math.sign(qty) === -1 ? 'negative-qty' : 'positive-qty';
        return qtyChange;
    }
}

